To solve this problem, we need to process an array of strings and convert each element to a number if it is a valid number within the range [0, 100]. If the element is not a valid number or falls outside this range, we should replace it with 0.

### Approach
1. **Iterate through each element** in the input array.
2. **Convert each element** to a floating-point number using `parseFloat` to handle both integer and decimal numbers.
3. **Check validity**:
   - Use `isNaN()` to determine if the conversion resulted in a valid number.
   - Ensure the number is within the inclusive range [0, 100].
4. **Push valid numbers** directly to the result array.
5. **Replace invalid entries** with 0 and push them to the result array.

### Solution Code
```javascript
function filterNumbers(arr) {
    let result = [];
    for (let i = 0; i < arr.length; i++) {
        let num = parseFloat(arr[i]);
        if (!isNaN(num) && num >= 0 && num <= 100) {
            result.push(num);
        } else {
            result.push(0);
        }
    }
    return result;
}
```

### Explanation
- **Iteration**: The function loops through each element of the input array.
- **Conversion and Validation**: Each element is converted to a number using `parseFloat`. The function checks if the result is a valid number (not `NaN`) and within the range [0, 100].
- **Result Construction**: Valid numbers are added to the result array as-is. Invalid entries (non-numbers or numbers outside the range) are replaced with 0 in the result array.
- **Return Result**: The processed result array is returned after processing all elements.

