// Piはmathパッケージでエクスポートされている
 小文字で始まるpiなどはエクスポートされていない名前
 パッケージをインポートすると、そのパッケージがエクスポートしている名前を参照することができる
 エクスポートされていない名前は、外部のパッケージからアクセスすることはできない
 関数をエクスポートする場合も同様に頭文字を大文字にする
 例えばmathパッケージのSin関数は大文字のSから始まるのでエクスポートされている
 fmt.Println(math.sin(math.Pi)) // エラー
 fmt.Println(math.Sin(math.Pi)) // 0になる
